Dove has created the 'perfect British mum’ – but can you spot what’s wrong with her? DOVE’S latest ad campaign involved placing Britain’s “perfect mum” across a massive billboard in London.
It’s got mums across the nation fuming ... do you notice something strange about her?
But the model isn’t even a mum.
Turns out, she isn’t even real.
Dove used artificial intelligence to create what a computer thinks is the ideal mother, based on our common perceptions.
It built ... on typical facial characteristics and created a new, unique image from the data alone.
The eerily flawless AI Perfect Mum, which Dove have called Aimee, has a composed, confident expression; fair, with sparkly green eyes; unblemished skin, and not a single blonde ... place.
It’s prompted fury on social media after it was unveiled on Monday, with several promising to boycott the babycare brand.


